2/22 🖤 
me and my loves @daijahanasa & @trey_best wrote this song after a really rough heartbreak & this song was only the start of many many more vulnerable & honest songs and inspiration for the rest of the project. I can’t believe it’s been over 2 YEARS since i’ve shared with you guys. I hope the wait wasn’t too long. I’m so happy to say Boomerang is finally out ✨🥹 link in my bio 🤍

